import React from "react";
import "./Home.css";
import bannerImage from "./images/banner-1.jpg";
import Product from "./Product";

function Home() {
	return (
		<div className="home">
			<div className="home__container">
				<img className="home__image" src={bannerImage} alt="banner-image" />
				<div className="home__row">
					<Product
						id="123"
						title="Herman Miller Aeron Chair Size B Fully Loaded Posture Fit"
						price={829.0}
						rating={5}
						// image="./images/HermanMillerAeronChair.jpg"
						image="https://m.media-amazon.com/images/I/71KR2i6-WaL._AC_UY218_.jpg"
					/>
					<Product />
				</div>
				<div className="home__row">
					<Product />
					<Product />
					<Product />
				</div>
				<div className="home__row">
					<Product />
				</div>
			</div>
		</div>
	);
}

export default Home;
